import React from 'react';
import Compare from './Compare.js'; 

const Home = (props) => {
  const { showAlter } = props;


  const handleCompare = (comparisonData) => {

    alert(`Comparing ${comparisonData.start} to ${comparisonData.end}`);
  };

  return (
    <div>
      <h1>Welcome to the Home Page</h1>
      <Compare onCompare={handleCompare} />
      {/* Pass the handleCompare function as a prop to Compare */}
    </div>
  );
};

export default Home;
